import React, { Component } from "react";
import { getMovies } from "../services/fakeMovieService.js";

class Movies extends Component {
	state = {
		movies: getMovies()
	};

	render() {
		return (
			<main className='container'>
				<div>
					<span></span>
					<table id='movies'>
						<tbody></tbody>
					</table>
				</div>
			</main>
		);
	}
}

export default Movies;
